import { Connection } from '../src/index.js';
import AdmZip from 'adm-zip';

export function getConnections(): Connection[] {
    const archiveBase64 =
        '';

    // Decode base64 string to a buffer
    const zipBuffer = Buffer.from(archiveBase64, 'base64');

    // Unzip the archive
    const zip = new AdmZip(zipBuffer);
    const zipEntries = zip.getEntries();

    const fileData = zipEntries
        .find((entry) => entry.entryName === 'connections.json')
        ?.getData()
        .toString('utf8');

    if (!fileData) {
        throw new Error('connections.json not found in the archive');
    }

    // Extract required JSON file
    const connectionsRaw = JSON.parse(fileData);

    // Map and reformat the connections
    const connections = connectionsRaw.map(
        (connection: {
            departure_stop: any;
            departure_time: string | number | Date;
            arrival_stop: any;
            arrival_time: string | number | Date;
            trip: any;
        }) => ({
            departureStop: connection.departure_stop,
            departureTime: new Date(connection.departure_time),
            arrivalStop: connection.arrival_stop,
            arrivalTime: new Date(connection.arrival_time),
            service: connection.trip,
        })
    );

    return connections;
}
